Gradients Without Calculus - JavaScript Code: function numericalGradient(f, x, h = 0.0001) {
  return (f(x + h) - f(x)) / h;
}

// Example: f(x) = x^2, we want to minimize it
const f = x => x * x;
let x = 5;
for (let i = 0; i < 100; i++) {
  const grad = numericalGradient(f, x);
  x = x - 0.1 * grad;  // Move opposite to gradient
}
console.log(x);  // ~0 (the minimum!)

